import React, {Component} from 'react'

class Post extends Component {
    componentDidMount(){
        console.log(this.props);
        const post_id = this.props.match.params.post_id;
    }
    render () {
        return (
            <div className="container center">
                Post param here {post_id}
            </div>
        )
    }
}
export default Post;
